INSERT INTO `series` (`id`, `image`, `nom`, `dure`, `description`, `video`, `episode`) VALUES
(1, 'data:image/jpeg;base64,', 'Breaking Bad', 5, 'Walter White, 50 ans, est professeur de chimie dans un lycée du Nouveau-Mexique. Pour réunir de l&#039;argent afin de subvenir aux besoins de sa famille, Walter met ses connaissances en chimie à profit pour fabriquer et vendre du crystal meth.', 'https://youtu.be/CoWsuFdqeYE?si=e9vVFf-8cBBdZBYS', 62),
(2, 'data:image/jpeg;base64,', 'Game of Thrones', 8, 'Neuf familles nobles rivalisent pour le contrôle du Trône de Fer dans les sept royaumes de Westeros. Pendant ce temps, des anciennes créatures mythiques oubliées reviennent pour faire des ravages.', 'https://youtu.be/aAF12LNAeNI?si=btibhdawyubtHGZn', 73),
(7, 'data:image/jpeg;base64,', 'The Last of Us', 2, 'Quand le monde tel que vous le connaissiez n\'existe plus, quand la ligne entre le bien et le mal devient floue, quand la mort se manifeste au quotidien, jusqu\'où iriez-vous pour survivre ? Pour Joel, la survie est une préoccupation quotidienne qu\'il gère à sa manière. Mais quand son chemin croise celui d\'Ellie, leur voyage à travers ce qui reste des États-Unis va mettre à rude épreuve leur humanité et leur volonté de survivre.', 'https://youtu.be/Sh4MVJLUNNY?si=QTos0BPIoU0_bKlb', 16);
INSERT INTO `series` (`id`, `image`, `nom`, `dure`, `description`, `video`, `episode`) VALUES
(9, 'data:image/jpeg;base64,', 'La casa de papel', 5, 'Huit voleurs font une prise d\'otages dans la Maison royale de la Monnaie d\'Espagne, tandis qu\'un génie du crime manipule la police pour mettre son plan à exécution.', 'https://youtu.be/_yJxbWKN3zE?si=Yw4eHfiTMx4Oa13O', 48),
(11, 'data:image/jpeg;base64,', 'Squid Game', 5, 'Huit voleurs font une prise d\'otages dans la Maison royale de la Monnaie d\'Espagne, tandis qu\'un génie du crime manipule la police pour mettre son plan à exécution.', 'https://youtu.be/_434vl32oJY?si=BvvyYvUjozjTEzJD', 48);
INSERT INTO `series` (`id`, `image`, `nom`, `dure`, `description`, `video`, `episode`) VALUES
(16, 'data:image/jpeg;base64,', 'helicopter heist', 1, 'Deux amis d\'enfance décident de se lancer dans un dernier braquage pour voler des millions dans un dépôt de fonds suédois ultrasécurisé. Mais la police veille.', 'https://youtu.be/98Bbyt_-Co8?si=t6EPMKTa_raeGIAD', 8),
(18, 'data:image/jpeg;base64,', 'THE 8 SHOW', 1, 'Huit personnes piégées dans un mystérieux immeuble de huit étages participent à un jeu télévisé tentant mais dangereux dans lequel leurs gains augmentent avec le temps.', 'https://youtu.be/JJxXEEPxVJE?si=5dpLJLGRBDgT09jS', 8),
(19, 'data:image/jpeg;base64,', 'Alice in Borderland', 2, 'Arisu, un obsédé de jeux vidéos, se retrouve soudainement dans une étrange version, totalement déserte, de Tokyo, et dans laquelle lui et ses amis doivent participer à des jeux dangereux pour survivre.', 'https://youtu.be/7O239-jHa6E?si=IDPgI2Xv4V8ubhy6', 16);
INSERT INTO `series` (`id`, `image`, `nom`, `dure`, `description`, `video`, `episode`) VALUES
(20, 'data:image/jpeg;base64,', 'See', 3, 'Dans un futur où l\'humanité a perdu la capacité de voir et est obligée d\'interagir de façon nouvelle, une paire de jumeaux voyants voit le jour et remet en question le statu quo.', 'https://youtu.be/GnEyl1YQJSE?si=SV0NPpRgR_ybl_Q3', 24),
(23, 'https://fr.web.img5.acsta.net/c_310_420/img/d9/3e/d93ec6814c0cb11911b146621e602386.jpeg', 'adolescence', 1, 'Lorsqu\'un ado de 13 ans est accusé de meurtre, sa famille, une psychologue clinicienne et l\'inspecteur chargé de l\'affaire se demandent ce qui s\'est vraiment passé.', 'https://youtu.be/P91lSUOotAM?si=MSEc7evGlEPfHQCF', 4),
(25, 'https://fr.web.img6.acsta.net/c_310_420/img/5b/12/5b122d409a2f195242ec82f327c2b0b9.jpg', 'You', 5, 'Joe, le gérant d\'une librairie new-yorkaise, devient obsédé par Beck, une jeune aspirante écrivaine qui partage sa passion pour les livres et pour la poésie. Persuadé qu\'ils sont faits l\'un pour l\'autre, il va alors se servir des réseaux sociaux pour nourrir son obsession, savoir en permanence où elle se trouve et ce qu\'elle fait, et tenter de faire tomber tous les obstacles qui pourraient se dresser en travers du chemin de leur possible romance. Quitte à commettre des actes totalement fous...', 'https://youtu.be/sDOWgRpgc3w?si=5HFItN8RHp1p3dMD', 50),
(26, 'https://fr.web.img6.acsta.net/c_310_420/pictures/23/11/24/15/39/5687502.jpg', 'Berlin', 1, 'En pleine gloire, Berlin réunit de talentueux équipiers à Paris pour réaliser l\'un de ses projets les plus ambitieux : dérober 44 millions d\'euros de bijoux, en une nuit.', 'https://youtu.be/pl90z2JZxNo?si=ii7RK2OYKsCub4i2', 8),
(27, 'data:image/jpeg;base64,', 'Lupin', 3, 'Il y a 25 ans, la vie du jeune Assane Diop est bouleversée lorsque son père meurt après avoir été accusé d\'un crime qu\'il n\'a pas commis. Aujourd’hui, Assane va s\'inspirer de son héros, Arsène Lupin - Gentleman Cambrioleur, pour le venger…', 'https://youtu.be/gCmuYqeeNpc?si=EKqbS-0nBMdke6IY', 17),
(28, 'https://fr.web.img6.acsta.net/c_310_420/pictures/22/06/07/11/57/5231272.jpg', 'Peaky Blinders', 6, 'En 1919, à Birmingham, soldats, révolutionnaires politiques et criminels combattent pour se faire une place dans le paysage industriel de l\'après-Guerre. Le Parlement s\'attend à une violente révolte, et Winston Churchill mobilise des forces spéciales pour contenir les menaces. La famille Shelby compte parmi les membres les plus redoutables. Surnommés les \"Peaky Blinders\" par rapport à leur utilisation de lames de rasoir cachées dans leurs casquettes, ils tirent principalement leur argent de paris et de vol. Tommy Shelby, le plus dangereux de tous, va devoir faire face à l\'arrivée de Campbell, un impitoyable chef de la police qui a pour mission de nettoyer la ville. Ne doit-il pas se méfier tout autant de la ravissante Grace Burgess ? Fraîchement installée dans le voisinage, celle-ci semble cacher un mystérieux passé et un dangereux secret.', 'https://youtu.be/F16x9poSXrc?si=ZR47JmREo5QgI5Gu', 36);

